{"0": ["Держала пришла поломанной", "2021-04-21T21:51:54Z", "красный", "0", 0, 1, 1, "Поилка для грызунов 80 мл 12,5Х4,5 см", "RIGERHAUS"], "1": ["Заказывала на 80, пришла на 120. Но это не плохо, поилка понравилась", "2021-03-29T11:41:57Z", "розовый", "0", 1, 0, 5, "Поилка для грызунов 80 мл 12,5Х4,5 см", "RIGERHAUS"], "2": ["В описании написано, что 80 мл, а пришла на 125, но это даже плюс. Не течет, без трещит и вмятин. Все супер :)", "2021-03-19T06:48:16Z", "розовый", "0", 1, 0, 5, "Поилка для грызунов 80 мл 12,5Х4,5 см", "RIGERHAUS"], "3": ["Все супер,полилка хорошо работает!", "2021-02-25T19:39:42Z", "желтый", "0", 1, 0, 5, "Поилка для грызунов 80 мл 12,5Х4,5 см", "RIGERHAUS"], "4": ["Ужасная, не заказывайте, деньги на ветер, все течёт ", "2021-02-19T13:05:37Z", "желтый", "0", 1, 1, 1, "Поилка для грызунов 80 мл 12,5Х4,5 см", "RIGERHAUS"], "5": ["НЕ ЗАКАЗЫВАЙТЕ!!!\nПрисылают совершенно другое, заказываешь на 125 мл\nПриходит на 60мл,80мл\nПродавец плохой, не советую", "2020-11-20T13:13:11Z", "желтый", "0", 0, 1, 1, "Поилка для грызунов 125 мл 12,5Х4,5 см", "RIGERHAUS"], "8": ["Вместо 125 мл только 80(даже на этикетке написано!!!!!!). За это минус две звезды. Пусть вас так дети кормят. Поилка работает, не ка́пает. Хомио быстро разобрался.", "2020-11-10T17:37:33Z", "желтый", "0", 0, 1, 3, "Поилка для грызунов 125 мл 12,5Х4,5 см", "RIGERHAUS"], "9": ["Заказывали объем 125 мл, а пришёл 80. Прошу не учитывать процент выкупа", "2020-11-04T14:37:13Z", "желтый", "0", 1, 1, 1, "Поилка для грызунов 125 мл 12,5Х4,5 см", "RIGERHAUS"], "11": ["Прислали не то, купила 125, пришла 60мл\nЦвет другой\nНа этикетке надпись верная, 125. Обидно", "2020-09-24T12:58:30Z", "зеленый", "0", 2, 0, 1, "Поилка для грызунов 125 мл 12,5Х4,5 см", "RIGERHAUS"], "12": ["Совсем не то прислали. Взяла только потому, что ехать надо, животному поилка срочно нужна.", "2020-09-24T12:09:28Z", "зеленый", "0", 1, 1, 1, "Поилка для грызунов 125 мл 12,5Х4,5 см", "RIGERHAUS"], "14": ["Поилка хорошая смогла прицепить на контейнер. Хомяк доволен! Советую.", "2020-08-12T11:53:18Z", "красный", "0", 2, 0, 5, "Поилка для грызунов 125 мл 12,5Х4,5 см", "RIGERHAUS"], "15": ["Поилка крепится к клетке на обычные проволочки. Это не удобно. Цвет скорее салатовый, яркий.", "2020-07-29T10:36:47.764104039Z", "зеленый", "0", 1, 1, 4, "Поилка для грызунов 125 мл 12,5Х4,5 см", "RIGERHAUS"]}
